import React from "react";
import ReactDOM from "react-dom";

ReactDOM.render(
  <>
    <h1>The value of pi</h1>
    <ol>
      <li>1</li>
      <li>2</li>
      <li>3</li>
    </ol>
  </>,
  document.getElementById("root")
);
